import React from 'react';
import logo from './logo_image.jpg';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './Component/Navbar.js';
import Home from './Component/Pages/Home.js';
import Product from './Component/Pages/Products.js';
import Review from './Component/Pages/Review.js';
import Wishlist from './Component/Pages/Wishlist.js';
import CreateAccount from './Component/Pages/CreateAccount.js';
import Order from './Component/Pages/Order.js';
import './App.css';

function App() {
  const handleSearch = () => {
    console.log('Perform search');
  };

  return (
    <div className="App">
      <header className="App-header">
        <div className="left-section">
          <img src={logo} className="App-logo" alt="logo" />
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
          </a>
        </div>
        <div className="search-bar">
          <input type="text" placeholder="Search..." />
          <button onClick={handleSearch}>Search</button>
        </div>
      </header>
      <Navbar />
      <Router>
        <Switch>
          <Route path="/" exact component={<Home />} />
          <Route path="/Product" component={<Product />} />
          <Route path="/Review" component={<Review />} />
          <Route path="/Wishlist" component={<Wishlist />} />
          <Route path="/Create-account" el={<CreateAccount />} />
          <Route path="/Order" element={<Order />} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
